import React from 'react'
import { Link } from 'react-router-dom'
import './components/css/dropdown.css'


class Auth extends React.Component {

  onSubmit(){

    localStorage.removeItem("UserId")
    localStorage.removeItem("validToken");
  }

  renderAuthButton () {

    if(!localStorage.getItem("validToken")){
      return (
        <div>
          <div class="dropdown">
            <button className ="ui ">Dropdown</button>
            <div class="dropdown-content">
              <a href="#">Link 1</a>
              <a href="#">Link 2</a>
              <a href="#">Link 3</a>
            </div>
          </div>
          <Link className='ui button red' to={`/user/login`}>Login</Link>
          <Link className='ui button primary' to={`/user/register`}> Register</Link>
          <div className ="ui secondary button">
            <a  href = "https://webrtc-video-room.herokuapp.com/">Start vedio chat</a>
          </div>
        </div>


      );
    }else {
      return(
        <div className='ui list'>
          <div><button className ='ui button cyan'><Link to ='/' onClick = {this.onSubmit}>logout</Link></button></div>
        </div>
      );
    }

  }

  render () {
    return <div>{this.renderAuthButton()}</div>;
  }
}

export default Auth
